import React from "react";
import { BrowserRouter, Route } from "react-router-dom";

// App Components
import Home from "./Home";

const App = () => (
  <BrowserRouter>
    <div className="container">
      <Routes>
        <Route path="/" component={Home} />
      </Routes>
    </div>
  </BrowserRouter>
);

export default App;
